'''Sune Lindqvist''' ({{lahirmati|[[Eskilstuna]], [[Swedia]]|20|3|1887||23|3|1976}}) merupakan [[arkeolog]] dan cendekiawan Swedia. Sune bekerja di [[Musium Sejarah Swedia]], tempat dia bertanggung jawab atas penemuan dari makam kapal di [[Valsgärde]], dan kemudian di [[Universitas Uppsala]], tempat Sune menulis dua karya utamanya selain beberapa ratus publikasi lainnya.

== Kehidupan awal dan pendidikan ==
Sune Lindqvist lahir dari pasangan Carl Axel Lindqvist dan Eva Mathilda Hermannia Brambeck pada 20 Maret 1887 di [[Eskilstuna]], [[Swedia]]. Sune ditinggal mati ayahnya sejak usianya masih kecil, dan dibesarkan bersama ketiga saudaranya yang lebih tua oleh ibunya. Sune mempelajari bahasa Nordik, geologi, dan mineralogi di bawah didikan gurunya yaitu [[Knut Stjerna]] andan [[Oscar Almgren]].{{sfn|Arwidsson|1980–1981}}

== Kehidupan pribadi ==
Sune wafat tiga hari selepas hari ulang tahunnya pada 23 Maret 1976.{{sfn|Arwidsson|1980–1981}}

== Publikasi ==
Di samping dua karya utamanya, ''Uppsala högar och Ottarshögen''{{sfn|Lindqvist|1936}} dan ''Gotlands Bildsteine'', Lindqvist menerbitkan lebih dari 200 artikel, catatan, dan tinjauan sejak 1909 hingga 1971.{{sfn|Arwidsson|1980–1981}}

