'''Zat besi''' adalah suatu [[zat]] dalam tubuh manusia yang erat dengan ketersediaan jumlah [[darah]] yang diperlukan.<ref name="Human"> {{en}} Garrow JS dan James WPT. 1993. ''Human Nutrition and Dietetics, Ninth Edition.'' Edinburgh: Churchill Livingstone. Page 174-180.</ref> Dalam tubuh [[manusia]] zat besi memiliki [[fungsi]] yang sangat penting, yaitu untuk mengangkut [[oksigen]] dari [[paru-paru]] ke [[jaringan]] dan mengangkut [[electron]] di dalam proses pembentukan [[energi]] di dalam sel.<ref name="Human"/> Untuk mengangkut oksigen, zat besi harus bergabung dengan [[protein]] membentuk [[hemoglobin]] di dalam sel darah merah dan [[myoglobin]] di dalam [[serabut otot]].<ref name="Nutrition"> {{en}} Drummond KE dan Brefere LM. ''Nutrition for Foodservice and Culinary Professional’s, Seventh Edition.'' New Jersey: John Wiley & Sons. Page 241-244.</ref> Bila bergabung dengan protein di dalam sel zat besi membentuk [[enzim]] yang berperan di dalam [[pembentukan energi]] di dalam [[sel]].<ref name="Human"/>

[[Laki-laki]] dewasa ([[berat badan]] 75 kg) mengandung ± 4000 mg zat besi, sementara [[wanita]] dewasa (berat badan 55 kg) mengandung ± 2100 mg zat besi.<ref name="Human"/> Laki-laki memiliki cadangan zat besi di dalam [[limpa]] dan [[sumsum tulang]] sebanyak 500-1500 mg, itulah sebabnya kekurangan darah (anemia) jarang dijumpai pada laki-laki.<ref name="Human"/> Sebaliknya, wanita hanya mempunyai cadangan zat besi 0 – 300 mg sehingga rentan terhadap [[anemia]], apalagi pada usia subur wanita mengalami [[menstruasi]].<ref name="Human"/>

Kebutuhan zat besi tergantung kepada [[jenis kelamin]] dan [[Umur manusia|umur]].<ref name="Human"/> Kecukupan yang dianjurkan untuk anak 2-6 tahun 4,7 mg/hari, usia 6-12 tahun 7,8 mg/hari, laki-laki 12-16 tahun 12,1 mg/hari, gadis 12-16 tahun 21,4 mg/hari, laki-laki dewasa 8,5 mg/hari, wanita dewasa usia subur 18,9 mg/hari, menopause 6,7 mg/hari, dan menyusui 8,7 mg/hari.<ref name="Human"/> Angka kecukupan ini dihitung berdasarkan [[ketersediaan hayati]] (''bioavailability'') sebesar 15%.<ref name="Nutrition"/> Zat besi dalam makanan dapat berasal dari [[sumber nabati]] dengan ketersediaan hayati 2-3% dan sumber hewani dengan ketersediaan hayati 20-23%.<ref name="Nutrition"/> Untuk meningkatkan ketersediaan hayati, zat besi yag berasal dari tumbuh-[[tumbuhan]] dapat ditambahkan dengan [[vitamin C]] dan [[asam organik]] lainnya.<ref name="Nutrition"/>

